import React from "react";

import { PlacesProvider } from "./placesContext";
import Header from "./components/header";
import InitialPage from "./pages/initialPage";
import Map from "./pages/Map";
import Graphic from "./pages/Graphic";
import About from "./pages/About";
import ScrollReveal from "scrollreveal";

import './styles/globalstyle.css'

window.sr = ScrollReveal({ reset: true});


ScrollReveal().reveal('.avaliation-card', { duration : 2000,  rotate: {x:0, y:100, z:0} });
ScrollReveal().reveal('.card', { duration:1000, rotate: {x:0, y:100, z:0 } })
ScrollReveal().reveal('.avaliacao', { duration:1000, distance: '100px', origin: 'top' })
ScrollReveal().reveal('.map img', { duration:1000, scale: 0.8 , rotate: {x:0, y:100, z:0 }})


function App() {
  return (
   <>
    <PlacesProvider>
    <Header/>

   <InitialPage/> 
    <Map/>
    <Graphic/>
   <About/>
   </PlacesProvider>
    </>
  );

}

export default App;
